String.prototype.toHHMMSS = function () {
    var sec_num = parseInt(this, 10); 
    var hours   = Math.floor(sec_num / 3600);
    var minutes = Math.floor((sec_num - (hours * 3600)) / 60);
    var seconds = sec_num - (hours * 3600) - (minutes * 60);
	var time = "";

	if (hours > 0) {
		time = hours + ":";
	}

	if (minutes > 9) {
		time += minutes;
	} else {
		time += "0" + minutes;
	}

	time += ":";

	if (seconds > 9) {
		time += seconds;
	} else {
		time += "0" + seconds;
	}

    return time;
}	
</script>

function updateNav(navElem, changeHash) {
	var active = navElem.parent().find('.active');
	active.removeClass('active');
	$('#'+$.trim(active.text()).toLowerCase()+'-container').css('display', 'none');

	navElem.addClass('active');
	var dest = $.trim(navElem.text()).toLowerCase();
	$('#'+dest+'-container').css('display', '');

	if (changeHash) {
		document.location.hash = dest;
	}

	$.event.trigger({
		type: "resize.rangeslider"
	});
}
